import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import './EnrutamientoAnidado.css';

export default function EnrutamientoAnidado() {
  return (
    <Router>
      <div>
      <div class="col-md-12">
          <div class="list-group"> 
              <Link  className="list-group-item active main-color-bg" to="/">Inicio</Link> 
          </div>  
          <div class="list-group"> 
            <Link  id="lPerfil" className="list-group-item"  to="/Perfil">Perfil</Link>
            </div>
          <div class="list-group"> 
            <Link className="list-group-item"  to="/Pendientes">Pendientes</Link>
          </div> 
          </div> 
        <Switch>
          <Route path="/Perfil">
            <Perfil />
          </Route>
          <Route path="/Pendientes">
            <Pendientes />
          </Route>
          <Route path="/">
            <Inicio />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

